/**
 * Return the first value as is without converting and CharSequence Objects
 */
public Object getFirstRawValue() {
  if (value instanceof Collection) {
    Collection c = (Collection<Object>) value;
    if (c.size() > 0) {
      return c.iterator().next();
    }
    return null;
  }
  return value;
}

